export default class CharCard extends Component {

    state={
        name: 'Shang Tsung'
    };

    render(){
        return(
            <div className='col-md-3 col-sm-6 mb-5'>
                <div className="card">
                    <div className="card-header">        
                        <h1>{name}</h1>
                    </div>   
                </div>
            </div>
        );      
    }   
}
